INSERT INTO `comment` (`commentId`, `detail`, `contentId`, `userId`, `dateCreate`) VALUES
(1, 'คนบ้างจำพวกเค้าเล่นเกมเพื่อธุระกิจในเกม หาตังจากเกมแปรเงินในเกมให้ได้เงินจริงใช้ รู้รึไม่ว่าบ้างคนเล่นเกมเป็นอาชีพหลักก็มี เดือนๆนี้เค้าเล่นเกมได้เงินจากตัวเกมเดือนนึงไม่ต่ำกว่า20-30kb อย่างน้อยที่สุดก็ หลัก10kbต่อเดือนไม่ได้โม้นะ เดี๋ยวจะมีคนมาคานว่างันคนเค้าก็ไปเล่นเกมกันหมดสิ ปล.มันคือส่วนน้อยที่ทำให้มันเป็นอาชีพเท่านั้นล่ะ คนอื่นเค้าเล่นเพื่อผ่อนคล้าย แต่คนกลุ่มน้อยก็เล่นเพื่อรายได้ เราก็คนกลุ่มน้อยนิดตรงนั้น และเราก็ไม่ชอบด้วยนี้ว่าได้ยินคนอื่นว่าไอ้พวกเด็กติดเกม เล่นเกมมันไม่ดีอย่าไปคบ เกม', 5, 1, '2014-06-05 15:59:00'),
(2, 'พวกห่านั้นมันเกิดมาพร้อม กับการละเล่น พวก มอญซ่อนผ้า หมากเก็บ วิ่งกะลา ปืนก้านกล้วย ตุ๊กกะตุ๋น กระโดเชือก ทอยแก่น ฯลฯอะไรพวกนี้ มันเลยยังไม่เข้าใจระบบเกมสมัยนี้ และชอบโชว์ว่าความคิดกรูนิแหล่ะสุดยอด ทุกคนต้องเชื่อฟัง บอกได้ประโยคเดียว... รีบๆๆไปตายห่าให้หมดซะ ...วงการเกมในประเทศไทยจะได้เปิดกว้างสักที', 5, 1, '2014-06-05 15:59:00');
INSERT INTO `content` (`contentId`, `title`, `image`, `detail`, `shortDetail`, `gameId`, `userCreate`, `userUpdate`, `dateCreate`, `dateUpdate`) VALUES
(15, 'Repair', '', '<p><span style="font-size:24px;"><strong><u>ระบบซ่อมแซมไอเทมที่ติดตั้ง</u></strong></span></p>\r\n\r\n<p>เมื่อตัวละครตายค่าความทนทานของไอเทมที่สวมใส่จะลดลง แต่เราสามารถทำการซ่อมแซมไอเทมที่สวมใส่ได้ที่ NPC ขายของ (Item dealer, Chef, Lottery Merchant etc.)&nbsp;ทุกตัว โดยมีขั้นตอนดังนี้</p>\r\n\r\n<p>1. กด F ที่ NPC ขายของเพื่อเปิดหน้าต่างร้านค้า ด้านล่างของหน้าต่างจะมีส่วนสำหรับการ ซ่อมแซม ปรากฎอยู่ในรายการซ่อมแซมจะแบ่งการซ่อม ดังนี้</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/repair/repair.jpg" style="width: 300px; height: 489px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1.1 เลือกแต่ละรายการเพื่อซ่อมแซม ในกรณีที่ต้องการซ่อมแซมไอเทมทีละชิ้น</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/repair/repair_1.jpg" style="width: 300px; height: 420px;" /></p>\r\n\r\n<p>1.2 ซ่อมแซมแค่ไอเทมที่ติดตั้ง หมายถึงการซ่อมแซมเฉพาะไอเทมที่กำลังสวมใส่อยู่</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/repair/repair_2.jpg" style="width: 300px; height: 482px;" /></p>\r\n\r\n<p>1.3 ซ่อมแซมไอเทมทั้งหมดที่มี จะเป็นการซ่อมทั้งไอเทมที่ใส่ติดตัวและไอเทมที่อยู่ในกระเป๋า</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/repair/repair_3.jpg" style="width: 300px; height: 485px;" /></p>\r\n\r\n<p>2. เมื่อเลือกทำรายการซ่อมแซมแล้ว ระบบจะแสดงหน้าต่างราคาที่ใช้ในการซ่อมแซม และให้กดตกลง</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/repair/repair_4.jpg" style="width: 300px; height: 146px;" /></p>\r\n\r\n<p>3. และเมื่อไอเทมที่เลือกได้รับการซ่อมแซมเรียบร้อยแล้ว ระบบจะแสดงข้อความแจ้งที่กล่องสนทนา</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/repair/repair_5.jpg" style="width: 500px; height: 192px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'ระบบซ่อมแซมไอเทมที่ติดตั้ง', 2, 3, 3, '2014-07-05 01:50:54', '2014-07-05 01:56:35'),
(16, 'Social', '', '<h2><span style="color:#FF0000;"><u><strong>1.</strong></u><strong><strong> </strong></strong><u><strong>Emotion</strong></u></span></h2>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/social/social_ges.png" style="width: 900px; height: 1012px;" /></p>\r\n\r\n<h2><span style="color:#FF0000;"><u><strong>2.</strong></u><strong> </strong><u><strong>Guild</strong></u></span></h2>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/social/social_guild.png" style="width: 900px; height: 436px;" /></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; <img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/social/social_guild2.jpg" style="width: 531px; height: 436px;" /></p>\r\n\r\n<table border="1" cellpadding="1" cellspacing="1" height="469" width="1154">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align: center; background-color: rgb(255, 255, 0); border-color: rgb(0, 0, 0);"><strong>เงื่อนไขในการสร้างกิลด์</strong></td>\r\n			<td style="text-align: center; background-color: rgb(51, 255, 0); border-color: rgb(0, 0, 0);"><strong>เงื่อนไขการยุบกิลด์</strong></td>\r\n			<td style="text-align: center; background-color: rgb(255, 51, 51); border-color: rgb(0, 0, 0);"><strong>เงื่อนไขในการโอนสิทธิ์หัวหน้ากิลด์</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="background-color: rgb(255, 255, 0); text-align: center; border-color: rgb(0, 0, 0);"><strong>1. ต้องไม่มีกิลด์สังกัดอยู่</strong></td>\r\n			<td style="background-color: rgb(51, 255, 0); text-align: center; border-color: rgb(0, 0, 0);"><strong>1. หัวหน้ากิลด์ต้องเป็นผู้ที่ยุบกิลด์เท่านั้น</strong></td>\r\n			<td style="background-color: rgb(255, 51, 51); text-align: center; border-color: rgb(0, 0, 0);"><strong>1. คนที่ได้รับโอนสิทธิ์ให้เป็นหัวหน้ากิลด์ จะต้องเป็นสมาชิกในกิลด์เดียวกัน</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="background-color: rgb(255, 255, 0); text-align: center; border-color: rgb(0, 0, 0);"><strong>2. ตัวละครต้องมีเลเวล 20 ขึ้นไป ถึงจะสามารถสร้างกิลด์ได้</strong></td>\r\n			<td style="background-color: rgb(51, 255, 0); text-align: center; border-color: rgb(0, 0, 0);"><strong>2. นอกจากหัวหน้ากิลด์แล้วยังเหลือ สมาชิกอยู่ในกิลด์จะไม่สามารถยุบกิลด์ได้</strong></td>\r\n			<td style="background-color: rgb(255, 51, 51); text-align: center; border-color: rgb(0, 0, 0);"><strong>2. คนที่ได้รับโอนสิทธิ์ให้เป็นหัวหน้ากิลด์ จะต้องมีเลเวล 20 ขึ้นไป</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="background-color: rgb(255, 255, 0); text-align: center; border-color: rgb(0, 0, 0);"><strong>3. ต้องจ่ายค่าธรรมเนียม 1 Gold</strong></td>\r\n			<td style="background-color: rgb(51, 255, 0); text-align: center; border-color: rgb(0, 0, 0);"><strong>3. ไอเทมที่อยู่ใน Storage Guild จะหายไปทันทีที่ทำการยุบกิลด์</strong></td>\r\n			<td style="background-color: rgb(255, 51, 51); text-align: center; border-color: rgb(0, 0, 0);"><strong>3. หลังจากได้รับโอนสิทธิ์ให้เป็นหัวหน้ากิลด์แล้ว ภายใน 7 วันจะไม่สามารถ โอนสิทธิ์ให้ผู้อื่นได้</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="background-color: rgb(255, 255, 0); text-align: center; border-color: rgb(0, 0, 0);"><strong>4. ชื่อกิลด์ต้องไม่เกิน 16 ตัวอักษร และห้ามเป็นอักษรพิเศษ</strong></td>\r\n			<td style="background-color: rgb(51, 255, 0); text-align: center; border-color: rgb(0, 0, 0);"><strong>4. ภายใน 7 วันหลังจากยุบกิลด์ สามารถตั้งกิลด์เดิมกลับมาได้</strong></td>\r\n			<td style="background-color: rgb(255, 51, 51); text-align: center; border-color: rgb(0, 0, 0);">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="background-color: rgb(255, 255, 0); text-align: center; border-color: rgb(0, 0, 0);"><strong>5. ชื่อกิลด์ห้ามซ้ำกับกิลด์อื่น ถึงแม้ว่ากิลด์นั้นจะถูกยุบไปแล้วก็ตาม</strong></td>\r\n			<td style="background-color: rgb(51, 255, 0); text-align: center; border-color: rgb(0, 0, 0);"><strong>5. หัวหน้ากิลด์ ภายใน 7 วัน หลังจาก ยุบกิลด์ จะไม่สามารถเข้าร่วมกับกิลด์อื่นได้</strong></td>\r\n			<td style="background-color: rgb(255, 51, 51); text-align: center; border-color: rgb(0, 0, 0);">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="background-color: rgb(255, 255, 0); text-align: center; border-color: rgb(0, 0, 0);"><strong>6. ชื่อกิลด์ห้ามเป็นคำหยาบ หรือคำต้องห้าม</strong></td>\r\n			<td style="background-color: rgb(51, 255, 0); text-align: center; border-color: rgb(0, 0, 0);">&nbsp;</td>\r\n			<td style="background-color: rgb(255, 51, 51); text-align: center; border-color: rgb(0, 0, 0);">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<div class="socialall">\r\n<h2>&nbsp;<span style="color:#FF0000;"><strong><u>ประกาศสงครามกิลด์</u></strong></span></h2>\r\n\r\n<div class="txtall">สามารถประกาศสงครามกิลด์ได้ก็ต่อเมื่อ กิลด์ที่ต้องการประกาศสงครามทั้ง2 กิลด์ อยู่ในสภาวะสงครามเท่านั้น (สามารถตั้งค่าได้ว่า ต้องการกิลด์เป็นสงบสุขหรือสงคราม) หลังจากประกาศสงครามกิลด์แล้ว</div>\r\n\r\n<div class="txtall">ระบบจะกำหนดวันเวลาในการทำสงครามกิลด์ โดยเมื่อถึงเวลาสงครามกิลด์แล้ว ผู้เล่นของทั้ง2 กิลด์สามารถต่อสู้กันได้เลยทันทีทุกที่ทุกเวลา จนกว่าเวลาสงครามจะสิ้นสุด (ในเขตเมืองหรือแค้มป์จะไม่สามารถต่อสู้ได้)</div>\r\n</div>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/social/social_guild3.png" style="width: 831px; height: 651px;" /></p>\r\n\r\n<h2><span style="color:#FF0000;"><u><strong>3.</strong></u><strong> </strong><u><strong>Party</strong></u></span></h2>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/social/social_party.png" style="width: 900px; height: 469px;" /></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; <img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/social/social_party2.png" style="width: 736px; height: 290px;" /></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/social/social_party3.png" style="width: 335px; height: 425px;" /></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; <img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/social/social_party4.png" style="width: 552px; height: 496px;" /></p>\r\n\r\n<p>credit : www.eos.in.th</p>\r\n', 'Social', 2, 6, 6, '2014-07-06 23:19:43', '2014-07-07 15:15:40'),
(14, 'Gem Stone&Rune', '', '<p style="text-align: center;"><span style="text-align: center; font-size: 16px;"><strong style="line-height: 1.6em;"><span style="font-size: 26px;">------------------Gem Stone</span></strong></span><strong style="text-align: center; font-size: 16px; line-height: 1.6em;"><span style="font-size: 26px;">------------------</span></strong><br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<span style="font-size:16px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ในการเสริมความแข็งเกร่งให้กับอุปกรณ์ต่างๆ นั้นต้องอาศัยGem Stoneมาช่วย โดยGem Stoneแต่ละสีก็จะมีคุณสมบัติที่แตกต่างกันออกไป และGem Stoneแต่ละสีนั้นจะถูกล๊อคตำแหน่งไว้แล้วว่าGem Stoneสีอะไรต้องใส่กับอุปกรณ์ส่วนไหน ไม่สามารถใส่กับอุปกรณ์ส่วนอื่นได้อย่างแน่นนอน และGem Stoneนั้นหาได้จากการทำเควสและสั้งหารมอนสเตอร์</span><br />\r\n&nbsp;</p>\r\n\r\n<h2><span style="font-size:16px;"><u>คุณสมบัติ</u><u>Gem Stone</u></span></h2>\r\n\r\n<p><span style="font-size:16px;">Gem Stoneแต่ละสีจะบวกค่าพลังที่ต่างกัน และแต่ละสีจะใส่ได้กับอุปกรณ์ส่วนเดียวเท่านั้น<br />\r\n<img alt="gem" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/gemrune/gamstone2.png" style="width: 698px; height: 406px;" /></span></p>\r\n\r\n<p><span style="font-size:16px;">อุปกรณ์ที่จะสามารถติดตั้งGem Stoneได้นั้นจำเป็นจะต้องมีช่องติดตั้งGem Stone ซึ่งอุปกรณ์ที่มีช่องติดตั้งGem Stoneนั้นสามรถหาได้จากการทำเควสและลงดันเจี้ยน</span></p>\r\n\r\n<h5><span style="font-size:16px;"><u>ขั้นตอนการติดตั้ง</u></span></h5>\r\n\r\n<ul>\r\n	<li><span style="font-size:16px;">&nbsp;กดShift + คลิกขวาที่อุปกรณ์ที่ต้องการจะติดตั้งGem Stone</span></li>\r\n	<li><span style="font-size:16px;">นำGem Stoneที่ตรงกับอุปกรร์นั้นมาใส่ในช่องติดตั้งGem Stone</span></li>\r\n	<li><span style="font-size:16px;"><span style="font-size:16px;">&nbsp;เลือก &ldquo;ตกลง&rdquo; เป็นอันเสร็จขั้นตอน<br />\r\n	<br />\r\n	ตัวอย่าง คลิป</span></span><br />\r\n	<iframe allowfullscreen="" frameborder="0" height="480" src="//www.youtube.com/embed/QDqGt3IWL-I" width="853"></iframe></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:16px;">เราสามารถถอดGem Stoneที่ติดตั้งอยู่ เพื่อที่จะติดตั้งGem Stoneอันใหม่ที่มีคุณสมบัติที่สูงกว่าได้ หรือจะถอดGem Stoneเพื่อนำไปใส่ในอุปกรณ์ชิ้นใหม่ก็ได้ โดยที่ไม่จำเป็นต้องทิ้งGem Stoneไป</span></p>\r\n\r\n<p><span style="font-size:16px;">การถอดGem Stoneนั้นจำเป็นจะต้องใช้ไอเทม &ldquo;Low class jewelry extract scroll&rdquo; หรือ &ldquo;Normal class jewelry extract scroll&rdquo; อย่างใดอย่างหนึ่ง ซึ่งสามารถหาซื้อได้ที่ NPC: &ldquo;Item Dealer&rdquo;</span><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<table border="0" cellpadding="0" style="width:50.0%;" width="50%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width:50.0%;">\r\n			<p align="center"><img alt="GEM" src="http://www.gurugames.in.th/images/upload/eos/gemrune/gamstone7.png" style="width: 56px; height: 56px;" /></p>\r\n			</td>\r\n			<td style="width:50.0%;">\r\n			<p align="center"><img alt="GEM" src="http://www.gurugames.in.th/images/upload/eos/gemrune/gamstone8.png" style="width: 56px; height: 56px;" /></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p align="center">Low class jewelry extract scroll</p>\r\n			</td>\r\n			<td>\r\n			<p align="center">Normal class jewelry extract scroll</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5><span style="font-size:16px;"><u>ขั้นตอนการถอด</u><u>Gen Stone</u></span></h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><span style="font-size:16px;">นำอุปกรณ์ที่ต้องการจะถอดGem Stoneออกจากการสวมใส่</span></li>\r\n	<li><span style="font-size:16px;">คลิกขวาที่ไอเทม &ldquo;Low class jewelry extract scroll&rdquo; หรือ &ldquo;Normal class jewelry extract scroll&rdquo; ไอคอนเมาท์จะเปลี่ยนเป็นรูปเพชร</span></li>\r\n	<li><span style="font-size:16px;">คลิกขวาที่อุกปรณ์ที่ต้องการถอดGem Stone</span></li>\r\n	<li><span style="font-size:16px;">เลือก &ldquo;ตกลง&rdquo; เป็นอันเสร็จขั้นตอน<br />\r\n	<br />\r\n	ตัวอย่างคลิป</span><br />\r\n	<br />\r\n	<iframe allowfullscreen="" frameborder="0" height="480" src="//www.youtube.com/embed/26l3fvz7NGc" width="853"></iframe></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1 align="center">&nbsp;</h1>\r\n\r\n<h2><span style="font-size:16px;"><u>วิธีตีบวก</u><u>Gem Stone</u></span></h2>\r\n\r\n<p><span style="font-size:16px;">ในเกมอื่นๆนั้นจะมีการตีบวกที่อุปกรณ์ ซึ่งจะมีข้อเสียคือ เมื่อต้องเปลี่ยนอุปกรณ์ก็จะต้องทิ้งค่าตีบวกที่เคยตีบวกไว้กับอุปกรณ์ชิ้นเก่าไป ไม่สามารถย้ายค่าตีบวกมายังอุปกรณ์ชิ้นใหม่ได้ แต่สำหรับEOS Onlineนั้นเราจะ<strong>ตีบวกไปที่</strong><strong>Gem Stone</strong>นั้นหมายความว่าเราสามารถ<strong>ย้ายค่าตีบวกจากอุปกรณ์ชิ้นเก่ามายังชิ้นใหม่</strong>ได้โดยการ ถอดGem Stoneจากอุปกรณ์เก่า และนำGem Stoneมาติดตั้งกับอุปกรณ์ใหม่ได้ หรือจะถอดGem Stoneเพื่อตีบวกให้สูงขึ้นแล้วนำกลับไปติดตั้งยังอุปกรณ์เก่าก็ยังได้</span></p>\r\n\r\n<h5><span style="font-size:16px;"><u>เงื่อนไขการตีบวก</u><u>Gem Stone</u></span></h5>\r\n\r\n<ul>\r\n	<li><span style="font-size:16px;">1. ในการจะตีบวกGem Stoneนั้นจำเป็นจะต้องมีGem Stone ที่มีสีเดียวกันและค่าบวกที่เท่ากัน 2เม็ด เช่น ต้องการจะตีบวกGem Stoneให้เป็น +2 ต้องมีGem Stone +1 สีเดียวกัน 2เม็ด</span></li>\r\n	<li><span style="font-size:16px;">2. ถ้าหากบวกไม่สำเร็จGem Stoneจะหายไปเพียง 1เม็ดเท่านั้น ยังคงเหลืออีก 1เม็ด</span></li>\r\n</ul>\r\n\r\n<h5><span style="font-size:16px;"><u>ขั้นตอนตีบวก</u><u>Gem Stone</u></span></h5>\r\n\r\n<ul>\r\n	<li><span style="font-size:16px;">1. คลิกขวาที่Gem Stoneที่ต้องการบวก</span></li>\r\n	<li><span style="font-size:16px;">2. ใส่จำนวนครั้งที่ต้องการบวก (ในกรณีที่มีGem Stone แบบเดียวกันหลายๆเม็ด)</span></li>\r\n	<li><span style="font-size:16px;">3. เลือก &ldquo;ตกลง&rdquo; หลังจากนั้นก็นั้งลุ้นว่าจะติดหรือไม่</span><br />\r\n	<span style="font-size:16px;">ตัวอย่าง คลิป</span><br />\r\n	<iframe allowfullscreen="" frameborder="0" height="480" src="//www.youtube.com/embed/ukM2Rd5iktI" width="853"></iframe><br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<h2><span style="font-size:16px;"><u>ระดับ</u><u>Gem Stone</u></span></h2>\r\n\r\n<p><span style="font-size:16px;">Gem Stone จะแบ่งเป็น 2 ระดับ Low Class และ Normal Class แต่ละระดับจะมีเงื่อนไขการใช้ที่ต่างกัน<br />\r\n<br />\r\n<img alt="gem" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/gemrune/gamstone10.png" style="width: 546px; height: 129px;" /></span><br />\r\n<br />\r\n<u><span style="font-size:16px;">ไอเทมเสริม</span></u></p>\r\n\r\n<p><br />\r\n<u><span style="font-size:16px;"><img alt="gem" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/gemrune/gamstone11.png" style="width: 698px; height: 131px;" /></span></u><br />\r\n<br />\r\n<span style="font-size:16px;">ปล. หลังจากที่ตีบวกรูปร่างของ Gem จะเปลี่ยนไปในแต่ละขั้น และสีของอาวุธก็จะเปลี่ยนด้วย<br />\r\n<br />\r\n<img alt="gem" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/gemrune/gamstone6.jpg" style="width: 656px; height: 449px;" /></span><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style="text-align: center;"><br />\r\n<span style="text-align: center; font-size: 16px;"><strong style="line-height: 1.6em;"><span style="font-size: 26px;">------------------Rune</span></strong></span><strong style="text-align: center; font-size: 16px; line-height: 1.6em;"><span style="font-size: 26px;">------------------</span></strong><br />\r\n&nbsp;</p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p><span style="font-size:16px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;แผ่นจารึกอักขระโบราณ ที่จะเสริมพลังโจมตีและพลังป้องกันให้แข็งแกร่งขึ้น โดยใช้ธาตุทั้ง 4 คือ ไฟ, น้ำ, ลม, ดิน Runeนั้นได้มาจากการเปิดกล่องที่ได้รับมาจากการผ่านเควสต่างๆ</span></p>\r\n\r\n<h2><span style="font-size:16px;"><u>คุณสมบัติ</u><u>Rune</u></span></h2>\r\n\r\n<p><span style="font-size:16px;">Runeนั้นจะติดตั้งได้กับอุปกรณ์แค่ 5 ประเภทคือ Weapon (อาวุธ), Earring (ต่างหู), Necklace (สร้อย), Bracelet (กำไล), Ring (แหวน)</span></p>\r\n\r\n<p><span style="font-size:16px;">เมื่อทำการติดตั้งRune ผู้เล่นจะต้องเลือก 1ใน4ธาตุ ที่ต้องการจากRune</span><br />\r\n<br />\r\n<img alt="Rune" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/gemrune/rune_img1.png" style="width: 898px; height: 179px;" /></p>\r\n\r\n<p><br />\r\n<span style="font-size:16px;"><span lang="TH" style="line-height: 115%; font-family: Tahoma, sans-serif; background: black;"><span style="background-color:#FFFFFF;">เมื่อทำการติดตั้ง</span></span><span style="line-height: 115%; font-family: Tahoma, sans-serif; background: black;"><span style="background-color:#FFFFFF;">Rune </span><span lang="TH"><span style="background-color:#FFFFFF;">จะเพิ่มพลังป้องกันโดยอัตโนมัติ</span></span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="line-height: 115%; font-family: Tahoma, sans-serif; background: black;"><span lang="TH"><span style="background-color:#FFFFFF;"><img alt="rume" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/gemrune/rune_img2.png" style="width: 898px; height: 213px;" /></span></span></span></span><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p><span style="font-size:16px;">Rune นั้นจะไม่สามารถถอดออกจากอุปกรณ์ได้ และเมื่อติดตตั้งRuneซ้ำไปยังอุปกรณ์ที่เคยติดตตั้งRuneไว้แล้ว ค่าพลังที่ได้รับจะเป็นของRuneอันใหม่ โดยไม่มีการสะสม</span></p>\r\n\r\n<h5><span style="font-size:16px;"><u>ขั้นตอนการติดตั้ง</u></span></h5>\r\n\r\n<ul>\r\n	<li><span style="font-size:16px;">1. คลิกขวาที่Runeจะปรากฏ หน้าต่างติดตั้งRune</span></li>\r\n	<li><span style="font-size:16px;">2. นำอุปกรณ์ไปใส่ที่ช่องในหน้าต่างติดตั้งRune</span></li>\r\n	<li><span style="font-size:16px;">3. เลือกธาตุที่ต้องการ (เฉพาะ Weapon (อาวุธ), Necklace (สร้อย) เท่านั้น)</span></li>\r\n	<li><span style="font-size:16px;">4. เลือก &ldquo;ตกลง&rdquo; เป็นอันเสร็จขั้นตอน<br />\r\n	<br />\r\n	ตัวอย่างคลิป</span><br />\r\n	<br />\r\n	<iframe allowfullscreen="" frameborder="0" height="480" src="//www.youtube.com/embed/_ry3s6srjxg" width="853"></iframe><br />\r\n	<br />\r\n	<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p>credit by : eos.in.th</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1 align="center">&nbsp;</h1>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="clear:both;">&nbsp;</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Gem&Rune', 2, 7, 7, '2014-07-05 00:37:35', '2014-07-05 01:05:29'),
(13, 'ระบบ Auction House', '', '<p style="text-align: center;"><span style="text-align: center; font-size: 16px;"><strong style="line-height: 1.6em;">&nbsp;&nbsp; &nbsp;<span style="font-size: 26px;">&nbsp;------------------Auction house</span></strong></span><strong style="text-align: center; font-size: 16px; line-height: 1.6em;"><span style="font-size: 26px;">------------------</span></strong></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p><strong style="line-height: 1.6em;"><span style="font-size:16px;"><span style="line-height: 1.6em;">Auction House ร้านฝากขายสินค้า เป็นระบบฝากขายในเกมเปรียบได้กับตลาดกลาง ที่คอยช่วยเหลือผู้เล่นในการซื้อขายไอเทมซึ่งกันและกัน โดยผู้เล่นสามารถตั้งขายสินค้าได้ที่ NPC: Consignment Shop Keeper จะอยู่ตามเมืองต่างๆ</span></span></strong></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p>ตัวอย่างเช่น เมือง Ignea<br />\r\n<br />\r\n<img alt="AuctionHouse" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/autionhouse/auction01.jpg" style="width: 739px; height: 608px;" /><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p><span style="font-size:16px;">ในหน้าร้านฝากขายสินค้าจะแบ่งออกเป็น 2 ส่วน ได้แก่ หน้าแสดงรายการไอเทมที่สามารถซื้อได้ และ หน้าแสดงไอเทมที่ผู้เล่นตั้งขาย</span></p>\r\n\r\n<p><span style="font-size:16px;"><strong>หน้าแสดงรายการไอเทมที่สามารถซื้อได้</strong>&nbsp;ผู้เล่นสามารถมาหาซื้อไอเทมที่ต้องการได้จากหน้านี้ โดยจะแสดงไอเทมที่ถูกตั้งขายทั้งหมด แบ่งไอเทมออกตามประเภทๆ และยังมีระบบค้นหาเพื่อให้ผู้เล่นง่ายต่อการค้นหาไอเทมที่ต้องการ<br />\r\n<br />\r\n<img alt="AuctionHouse" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/autionhouse/auctionimg2.jpg" style="width: 628px; height: 523px;" /><br />\r\n<br />\r\n<strong>หน้าแสดงไอเทมที่ผู้เล่นตั้งขาย</strong>&nbsp;ผู้เล่นสามารถตั้งขายไอเทมได้ที่หน้านี้ โดยหน้านี้จะแสดงให้เห็นถึงไอเทมทั้งหมดที่ผู้เล่นตั้งขายไว้ และเมื่อขายไอเทมได้แล้ว ผู้เล่นจะต้องมากดรับเงินที่หน้านี้</span></p>\r\n\r\n<p><br />\r\n<span style="font-size:16px;"><img alt="AuctionHouse" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/autionhouse/auctionimg3.jpg" style="width: 800px; height: 500px;" /><br />\r\n<br />\r\n<strong>สิ่งที่ควรรู้</strong></span></p>\r\n\r\n<ul>\r\n	<li><span style="font-size:16px;">&nbsp;เมื่อผู้เล่นตั้งขายจะต้องเสียค่าธรรมเนียม 2% ของราคาที่ตั้งขาย</span></li>\r\n	<li><span style="font-size:16px;">ไอเทมที่ตั้งขาย จะมีระยะเวลา 24 ชั่วโมง หลังจากนั้นการตั้งขายจะถูกยกเลิก</span></li>\r\n	<li><span style="font-size:16px;">หลังจากรับเงินจากการขายของแล้ว ผู้ขายจะโดนหักภาษี 5% จากเงินที่ได้รับ</span></li>\r\n	<li><span style="font-size:16px;">&nbsp;ระบบร้านฝากขายสินค้า สามารถเข้าผ่าน EOS Mobile Application ได้</span></li>\r\n</ul>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>credit by : eos.in.th<br />\r\n&nbsp;</p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'ระบบ Auction House', 2, 7, 7, '2014-07-04 23:54:27', '2014-07-05 00:03:06'),
(9, 'Mount & Pet', '', '<h1><span style="font-size:36px;"><strong>MOUNT</strong></span></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>สัตว์ขี่ในเกม EOS Online มีให้ผู้เล่นเลือกได้หลากหลายเพื่อให้เหมาะสมกับสไตล์และความชอบของแต่ละคน นอกจากนี้ยังมีความสวยงามทำให้ผู้ที่ขี่นั้นดูสง่า สมกับเป็นนักรบแห่ง Arcana</p>\r\n\r\n<p>สัตว์ขี่นั้นนอกจากจะเพิ่มความสวยงานภายนอกแล้วยังเพิ่มคุณสมบัติอื่นๆ ให้กับผู้ขี่อีกด้วย<br />\r\nคุณสมบัติของสัตว์ขี่</p>\r\n\r\n<p><img alt="" class="img-responsive" height="189" src="http://www.gurugames.in.th/images/upload/eos/Mount_pet/20130903223915a0dkjx1klbjqzt9g.jpg" width="282" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; 1. เพิ่มความเร็วในการเคลื่อนที่<br />\r\n&nbsp;&nbsp;&nbsp; 2. ทำให้ขอบเขตการมองเห็นของมอนสเตอร์ลดลง (มีโอกาสที่จะไม่โดนมอนสเตอร์ประเภทโจมตีอัตโนมัติโจมตีก่อน)<br />\r\n&nbsp;&nbsp;&nbsp; 3. ลดโอกาสการตกลงจากสัตว์ขี่ เมื่อถูกมอนสเตอร์ โจมตี</p>\r\n\r\n<p>วิธีการใช้สัตว์ขี่<br />\r\nผู้เล่นจำเป็นจะต้องเรียนรู้ทักษะ &ldquo;Normal vehicle license&rdquo; ก่อนถึงจะสามารถขี่สัตว์ขี่ได้ โดยทักษะนี้จะได้รับจากการผ่านเควส หรือสามารถหาซื้อได้NPC &ldquo;Experts Vehicles&rdquo;</p>\r\n\r\n<p><img alt="Item Vehicle Elementary License" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/Mount_pet/EOS20140607190653898.jpg" style="width: 152px; height: 52px;" /></p>\r\n\r\n<h1>&nbsp;</h1>\r\n\r\n<h1><span style="font-size:36px;"><strong>PET</strong></span></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>สัตว์เลี้ยงในเกม EOS Online เป็นสิ่งที่ผู้เล่นทุกคนควรจะมีเพราะนอกจากความน่ารักแล้วขี้อ้อนของเหล่าสัตว์เลี้ยงแล้วสัตว์เลี้ยงยังมีคุณสมบัติเพิ่มให้อีกด้วย คือ</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; 1. สามารถเพิ่มช่องกระเป๋า สำหรับเก็บไอเทมให้กับเจ้าของ<br />\r\n&nbsp;&nbsp;&nbsp; 2. เป็นผู้ช่วยในการเก็บของ สามารถวิ่งไปเก็บของที่ดรอปให้กับเจ้าของได้อัตโนมัติ</p>\r\n\r\n<p>โดยสัตว์เลี้ยง 1 ตัวนั้นจะมีคุณสมบัติเพียง 1 อย่างเท่านั้น</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/Mount_pet/petimg02.png" style="width: 157px; height: 154px;" /></p>\r\n\r\n<p>credit : www.eos.in.th</p>\r\n', 'Mount & Pet', 2, 6, 6, '2014-07-04 15:18:54', '2014-07-04 15:21:33'),
(11, 'BattleSystem', '', '<p style="text-align: center;"><span style="font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center; font-size: 16px;"><strong style="line-height: 1.6em;"><span style="font-size: 26px;">&nbsp;</span></strong></span></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p style="text-align: center;"><span style="font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center; font-size: 16px;"><strong style="line-height: 1.6em;"><span style="font-size: 26px;">------------------Battle&nbsp;System</span></strong></span><strong style="font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; text-align: center; font-size: 16px; line-height: 1.6em;"><span style="font-size: 26px;">------------------</span></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/BattleSystem/battleimg01.png" /></p>\r\n\r\n<p>ศึกแห่งศักดิ์ศรีการต่อสู้อย่างยุติธรรม คือการต่อสู้แบบ 1 : 1 ซึ่งผู้เล่นทั้ง 2คน จะต้องมีความยินยอมที่จะต่อสู้กัน เพื่อพิสูจน์ว่าใครจะเหนือกว่าใคร หลังจากจบการต่อสู้ตัวละครจะแสดงท่าทางดีใจสำหรับผู้ชนะและแสดงท่าทางเสียใจสำหรับผู้แพ้<br />\r\nวิธีการ PVP (Duel)<br />\r\n1. คลิกขวาที่เป้าหมายที่เลือก &ldquo;ขอดวลต่อสู้&rdquo;<br />\r\n2. จะปรากฎหน้าต่าง &ldquo;รับคำขอดวลต่อสู้&rdquo; ที่เป้าหมาย เป้าหมายสามารถรับคำขอดวลต่อสู้หรือไม่ก็ได้<br />\r\n3. ถ้าหากรับคำท้าจะมีเวลาเตรียมตัว 3 วินาที<br />\r\n4. เมื่อสามารถต่อสู้ได้ ปรากฎธงศึกออกมา</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style="text-align: center;"><iframe width="560" height="315" src="//www.youtube.com/embed/0uzp30lznOY" frameborder="0" allowfullscreen></iframe></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p style="text-align: center;">คลิกเพื่อดู VDO</p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p>Credit :&nbsp;http://eos.gg.in.th</p>\r\n\r\n<p>&nbsp;</p>', '', 2, 4, 4, '2014-07-04 17:06:14', '2014-07-04 18:53:31');
INSERT INTO `content` (`contentId`, `title`, `image`, `detail`, `shortDetail`, `gameId`, `userCreate`, `userUpdate`, `dateCreate`, `dateUpdate`) VALUES
(6, 'Craft Skill', '', '<p><span style="font-size:24px;"><u><strong>ระบบ Craft Skill</strong></u></span></p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/ignea.jpg" style="width: 649px; height: 380px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>EOS ได้แบ่งระบบการคราฟไอเทม ออกเป็น 2 ประเภท&nbsp;</p>\r\n\r\n<ol>\r\n	<li><strong><u>ทักษะอาชีพหลัก</u></strong></li>\r\n</ol>\r\n\r\n<p>ทักษะอาชีพหลักนั้น สามารถเลือกเรียนได้เพียง 1 อย่างเท่านั้น แบ่งออกเป็น 3 สาย ดังนี้</p>\r\n\r\n<p>1.1 Resource Collector</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/ResourcesCollector.jpg" style="width: 200px; height: 300px;" /></p>\r\n\r\n<p>คือ ทักษะการรวบรวมทรัพยากรต่างๆ เช่น ขุดแร่ เก็บเกี่ยวสมุนไพร ซึ่งทักษะอาชีพนี้ สามารถขุดแร่ (Tip: มีโอกาสขุดแล้วได้ Gem สีต่างๆด้วย)&nbsp;และเก็บเกี่ยวสมุนไพรที่กระจายอยู่ตามแผนที่ต่างๆได้ ทรัพยากรที่ได้มาเป็นวัตถุดิบตั้งต้นที่มีความสำคัญมากในการนำไปผลิตไอเทมในทักษะอื่นๆ&nbsp;</p>\r\n\r\n<p>1.2 Jeweler</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/Jeweler.jpg" style="width: 200px; height: 300px;" /></p>\r\n\r\n<p>คือ ทักษะการทำอัญมณี สร้อยคอ และสร้อยข้อมือ โดย Jeweler สามารถสกัดแร่ที่ Resource Collector ได้ทำการขุดมาให้กลายเป็นวัตดุดิบที่ในการเพิ่มประสิทธิภาพของอัญมณีเครื่องประดับต่างๆได้</p>\r\n\r\n<p>1.3 Alchemist</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/Alchemist.jpg" style="width: 200px; height: 300px;" /></p>\r\n\r\n<p>คือ ทักษะในการเล่นแร่แปรธาตุ จากสมุนไพรธรรมดาที่ถูกเก็บเกี่ยวโดย Resource Collector นั้น นักเล่นแร่แปรธาตุสามารถนำมาปรุงแต่งให้กลายเป็นน้ำยาสารพัดประโยชน์ได้ อีกทั้ง นักเล่นแร่แปรธาตุยังมีความสามารถในการสร้าง แหวนและต่างหูอีกด้วย</p>\r\n\r\n<p style="margin-left:.5in;">&nbsp;</p>\r\n\r\n<ol>\r\n	<li value="2"><strong><u>ทักษะอาชีพรอง</u></strong></li>\r\n</ol>\r\n\r\n<p>ทักษะอาชีพรอง นั้นแบ่งออกเป็น 2 ทักษะ คือ Soul Professional และ Chef ซึ่งสามารถเรียนรู้ได้ทั้ง 2 ทักษะพร้อมกัน</p>\r\n\r\n<p>2.1 Soul Professional</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/SoulProfessional.jpg" style="width: 200px; height: 300px;" /></p>\r\n\r\n<p>คือ ทักษะในการสกัดโซลจากอุปกรณ์ต่างๆ รวมไปถึงการสร้างโซลใหม่ขึ้นมาเพื่อนำไปเป็นวัตถุดิบในการผลิตอุปกรณ์อื่นๆอีกด้วย</p>\r\n\r\n<p>2.2 Chef</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/Chef.jpg" style="width: 200px; height: 300px;" /></p>\r\n\r\n<p>มีหน้าที่รังสรรค์อาหารเพื่อเติมเต็มความหิวโหย และเพิ่มบัฟพิเศษให้แก่เหล่า Arcana ได้</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:20px;"><strong><u>วิธีการสมัครเรียนทักษะ</u></strong></span></p>\r\n\r\n<p>การเรียนทักษะอาชีพต่างๆนั้น สามารถสมัครเรียนกับผู้เชี่ยวชาญที่ประจำอยู่ตามเมืองและ camp ต่างๆ โดยสังเกตได้จากวัญลักษณ์ผู้เชี่ยวชาญด้านต่างๆใน minimap</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/craft_prof_sign.jpg" style="width: 275px; height: 299px;" /></p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/craft_prof_sign2.jpg" style="width: 200px; height: 218px;" /></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p><span style="line-height: 1.6em;">1. กดคุยกับ NPC ผู้เชี่ยวชาญนั้นๆ&nbsp;โดย&nbsp;</span><span style="font-family: Segoe, ''Segoe UI'', ''DejaVu Sans'', ''Trebuchet MS'', Verdana, sans-serif; font-size: 14px; line-height: 18.200000762939453px;">NPC แต่ละคนจะมีระบุชื่อทักษะอยู่ใต้ชื่อ </span><span style="line-height: 1.6em;">แล้วเลือก เรียนรู้</span></p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/learning1.jpg" style="width: 200px; height: 356px;" /></p>\r\n\r\n<p>2. จากนั้น กดเลือกทักษะ แล้วกดปุ่ม เรียน โดยทักษะที่เราสามารถเรียนได้ ณ ขณะนั้นจะมีสี ส่วนทักษะที่ยังไม่ตรงตามเงื่อนไข จะยังไม่สามารถกดเรียนได้</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/learning2.jpg" style="width: 200px; height: 327px;" /></p>\r\n\r\n<p>3. เมื่อระบบขึ้นแจ้งว่า ได้ทำการสะสมเทคนิคแล้ว ให้้เลื่อน scroll ลงมาเพื่อเลือกไอเทมที่ต้องการคราฟ แล้วกด เรียน&nbsp;</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/learning3.jpg" style="width: 200px; height: 277px;" /></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p><strong style="font-size: 20px;"><u>วิธีการคราฟไอเทม</u></strong></p>\r\n\r\n<p>1. ให้กดปุ่ม J เพื่อเปิดเมนู Craft Skill ขึ้นมา แล้วเลือก Skill ที่ต้องการคราฟ</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/menu_j.jpg" style="width: 200px; height: 314px;" /></p>\r\n\r\n<p>2. กดเลือกรายการไอเทมที่ต้องการคราฟ จากนั้นจะมีรายการไอเทมวัตุดิบที่ต้องใช้ในการคราฟแสดงขึ้นมา หากมีวัตถุดิบพร้อมแล้ว สามารถกดสร้างตามจำนวนที่ต้องการ หรือกดสร้างทั้งหมดก็ได้</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/cook1.jpg" style="width: 400px; height: 358px;" /></p>\r\n\r\n<p>3. หากเป็นทักษะ Resource Collector สามารถเก็บเกี่ยวหรือขุดทรัพยากรตามแผนที่ต่างๆ โดยสามารถสังเกตได้จากสัญลักษณ์สามเหลี่ยมใน minimap ได้&nbsp;</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/minimap.jpg" style="width: 200px; height: 219px;" /></p>\r\n\r\n<p style="text-align: center;">สามเหลี่ยมสีส้มหมายถึงวัตถุดิบประเภทสมุนไพร ส่วนสีเทาหมายถึงแร่ต่างๆ</p>\r\n\r\n<p>4. การเก็บเกี่ยวสามารถทำได้โดยการกด F หรือคลิ๊กขวาที่วัตถุดิบนั้นๆ มุมขวาล่างจะแสดงชื่อ,&nbsp;สีของระดับ และเลเวลที่ต้องการในการเก็บวัตถุดิบนั้นๆ</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/gathering.jpg" style="width: 400px; height: 193px;" /></p>\r\n\r\n<p>หมายเหตุ: การคราฟไอเทมต่างๆจะมีระดับในการสร้างเพื่อเพิ่มเลเวลทักษะการคราฟเรียงตามสี ดังนี้&nbsp;</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/cook2.jpg" style="width: 400px; height: 358px;" /></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:16px;">สีส้ม &gt; สีเหลือง &gt; สีเขียว &gt; สีเทา&nbsp;</span></p>\r\n\r\n<p>ระดับสีนั้นจะบอกถึงเลเวลที่เราจะได้เมื่อทำทักษะนั้นๆ ตามลำดับ &nbsp;โดยหากเลือกี่ยการที่มีสีเทาจะไม่ได้ค่าเลเวลใดๆทั้งสิ้น</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong style="font-size: 20px;"><u>วิธีการยกเลิกการเรียนทักษะ</u></strong></p>\r\n\r\n<p>1. การยกเลิกเรียนทักษะอาชีพต่างๆนั้น สามารถยกเลิกกับผู้เชี่ยวชาญที่ประจำอยู่ตามเมืองและ camp โดยกดคุยกับ NPC ผู้เชี่ยวชาญนั้นๆ แล้วกด ยกเลิก</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/cancel_craft1.jpg" style="width: 200px; height: 358px;" /></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p>2. กดยืนยันเพื่อทำการยกเลิกทักษะ</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/craft_skill/cancel_craft2.jpg" style="width: 200px; height: 102px;" /></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n', 'ระบบการคราฟไอเท็ม', 2, 3, 3, '2014-06-26 10:30:38', '2014-07-04 15:34:27'),
(19, 'เตรียมพร้อมเข้า Battlefield PvP เลเวล 60', '', '<p>การเตรียมพร้อมสำหรับเข้า Arena&nbsp;Battlefield PvP เลเวล 60 นั้น ต้องเริ่มจากการซื้ออาวุธ เครื่องแต่งกาย และเครื่องประดับ เนื่องจากอุปกรณ์เลเวล 60 นั้นจะมีหน่วยพิเศษ คือ Player Penetration และ Player Defense&nbsp;ซึ่งจะมีเฉพาะอุปกรณ์สำหรับการ PvP เท่านั้น&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ในเมือง Ignea จะมี NPC ที่ขายอุปกรณ์สำหรับการ PvP อยู่ ชื่อ Rubens</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/Rubens.jpg" style="width: 1000px; height: 766px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>อุปกรณ์ แต่ละชิ้น ราคาจะอยู่ที่เกือบๆ 10 G ซื้อครบทั้งชุดใช้เงินราวๆ 100 G&nbsp;</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/shop.jpg" style="width: 350px; height: 559px;" /></p>\r\n\r\n<p>รายละเอียดอุปกรณ์แต่ละชิ้น ซึ่งถ้าใส่ครบเซ็ท ยังได้ความสามารถพิเศษของเซ็ทเพิ่มมาอีกด้วย</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/detail.jpg" style="width: 450px; height: 879px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/detail2.jpg" style="line-height: 1.6em; width: 450px; height: 853px;" /></p>\r\n\r\n<p>และเมื่อตัวละครเปลี่ยนเป็นชุดสำหรับการ PvP ตัวละครจะมีค่าประสิทธิภาพของการ PvP เป็น 100%</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/stat.jpg" style="width: 650px; height: 618px;" /></p>\r\n', '', 2, 3, 3, '2014-07-25 21:47:30', '2014-07-25 21:55:37'),
(18, 'การออกจาก guild', '', '<p>การออกจาก Guild ทำได้โดย</p>\r\n\r\n<p>1. กดปุ่ม G เพื่อเรียกหน้าต่าง guild ให้แสดงขึ้นมา</p>\r\n\r\n<p>2. จากนั้นกด tab รายชื่อ</p>\r\n\r\n<p>3. คลิ๊กขวาที่รายชื่อตัวละครของเรา จากนั้นกด ออกจากกิลด์</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/quit_guild.jpg" style="width: 400px; height: 529px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 2, 3, 3, '2014-07-25 21:26:23', '2014-07-25 21:28:13'),
(10, 'Interface&Control', '', '<p style="text-align: center;"><span style="font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center; font-size: 16px;"><strong style="line-height: 1.6em;">&nbsp;&nbsp;<span style="font-size: 26px;">&nbsp;------------------Interface &amp; Control</span></strong></span><strong style="font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; text-align: center; font-size: 16px; line-height: 1.6em;"><span style="font-size: 26px;">------------------</span></strong></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/InterfaceControl/interface1.jpg" /></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p style="text-align: center;"><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/InterfaceControl/interface2.png" /></p>\r\n\r\n<p><span style="line-height: 1.6em;">Credit :&nbsp;http://eos.gg.in.th</span></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 2, 4, 4, '2014-07-04 16:46:10', '2014-07-04 16:49:03'),
(5, 'EOS Online ปล่อยทีเซอร์เด็ดตัวใหม่ ยั่วน้ำลายสาวก MMO', 'http://www.gurugames.in.th/images/upload/eos/Echo-of-Soul-EOS-Online-Archer-gameplay1-290x140.jpg', '<div class="post-34551 post type-post status-publish format-standard has-post-thumbnail hentry category-gamethai tag-echo-of-soul tag-echo-of-soul- tag-eos tag-eos-online tag-eos-online- tag-eos-thai tag-222 tag-14 tag-902 tag-1370 tag-116 entry-content clearfix">\r\n<h1 class="entry-title" style="text-align: center;">&nbsp;</h1>\r\n\r\n<div class="entry-meta">\r\n<div class="social4i" style="height:29px;float: right;">\r\n<div class="social4in" style="height: 29px; float: right; text-align: center;"><br />\r\n<br />\r\n&nbsp;</div>\r\n\r\n<div style="clear: both; text-align: center;">&nbsp;</div>\r\n</div>\r\n</div>\r\n\r\n<p style="text-align: center;"><img alt="EOSchar" height="337" src="http://www.game-ded.com/wordpress/wp-content/uploads/2014/01/EOSchar.jpg" width="600" /></p>\r\n\r\n<p style="text-align: center;"><span style="line-height: 1.6em;">หลังจาก </span><span style="line-height: 1.6em; color: rgb(255, 0, 0);">True Digital Plus</span><span style="line-height: 1.6em;"> เปิดตัวเกมส์ออนไลน์ใหม่ </span><span style="line-height: 1.6em; color: rgb(0, 0, 255);"><strong>EOS Online</strong></span><span style="line-height: 1.6em;"> ไปเมื่อสัปดาห์ที่แล้ว ซึ่งกระแสตอบรับเรียกได้ว่าทำเอาวงการ </span><span style="line-height: 1.6em; color: rgb(0, 128, 0);">MMORPG</span><span style="line-height: 1.6em;"> กลับมาคึกคักอีกครั้ง หลังจากไม่มีเกมส์ฟอร์มยักษ์เข้ามาเปิดในประเทศไทยในช่วงปีที่ผ่านมา และล่าสุด EOS Online ได้ปล่อยทีเซอร์ตัวใหม่ออกมายั่วน้ำลายสาวก MMORPG อีกระลอก</span></p>\r\n\r\n<p style="text-align: center;"><iframe allowfullscreen="" frameborder="0" height="480" id="fitvid482705" scrolling="no" src="//www.youtube.com/embed/OVFEO8hfGi4" width="640"></iframe></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p style="text-align: center;">ซึ่งในทีเซอร์ตัวล่าสุด&nbsp;<span style="color: #800080;">BEYOND LEGENDARY</span> โชว์ความอลังการของ <span style="color: #008000;">Character</span> ที่ฉีกทุกกฏที่เคยมีมา ใหม่กว่าทุกครั้งที่เคยสัมผัส กับ THE BEST MMORPG 2014</p>\r\n\r\n<p style="text-align: center;"><img alt="EOSchar1" class="aligncenter size-full wp-image-34553" height="404" src="http://www.game-ded.com/wordpress/wp-content/uploads/2014/01/EOSchar1.jpg" style="text-align: center; line-height: 1.6em;" width="600" /></p>\r\n\r\n<p style="text-align: center;">สำหรับเกมส์ <span style="color: #0000ff;"><strong>EOS Online</strong></span> นั้นมีสายอาชีพทั้งหมด 5 อาชีพ ได้แก่<span style="color: #800080;"> Warrior, Rogue, Guardian, Sorceress</span> และ <span style="color: #800080;">Archer</span> ซึ่งเพื่อนๆ สามารถติดตามรายละเอียดเพิ่มเติม หรือตามติดข่าวสารการอัพเดทของสุดยอดเกมส์ MMO ได้ก่อนใครทาง <span style="color: #008080;">www.eos.in.th</span> หรือ <span style="color: #008080;">www.facebook.com/EOSThai</span></p>\r\n\r\n<p style="text-align: center;">นอกจากทีเซอร์ BEYOND LEGENDARY แล้ว เรายังมีคลิปวิดีโอแนะนำการสร้างตัวละครมาฝากกันด้วยจ้า</p>\r\n\r\n<p style="text-align: center;"><iframe allowfullscreen="" frameborder="0" height="480" id="fitvid473830" scrolling="no" src="//www.youtube.com/embed/HtTHDnnUB1c?rel=0" width="640"></iframe></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p style="text-align: center;">หากมีความคืบหน้าเพิ่มเติม เกี่ยวกับกำหนดการเปิดให้บริการเกมส์ออนไลน์ใหม่&nbsp;<strong><span style="color: #0000ff;">E</span><span style="color: #0000ff;">OS Online (Echo of Soul)</span></strong> ทางทีมงาน Game-Ded จะรีบนำมาแจ้งให้เพื่อนๆ ทราบครับ</p>\r\n\r\n<p style="text-align: center;">ข่าว <a href="http://www.game-ded.com/wordpress" target="_blank">เกมส์ออนไลน์</a> By Game-Ded</p>\r\n</div>\r\n', 'EOS Online ปล่อยทีเซอร์เด็ดตัวใหม่ ยั่วน้ำลายสาวก MMO', 2, 5, 5, '2014-06-25 00:48:57', '2014-07-03 19:25:01'),
(8, 'Soul System Guide', '', '<p style="text-align: center;"><span style="font-size:16px;"><strong style="line-height: 1.6em;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style="font-size:26px;">&nbsp;------------------Soul System</span></strong></span><strong style="font-size: 16px; text-align: center; line-height: 1.6em;"><span style="font-size: 26px;">------------------</span></strong></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p style="text-align: justify;">&nbsp;</p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:16px;"><strong style="line-height: 1.6em;">Soul</strong><span style="line-height: 1.6em;"> &nbsp;</span><strong style="line-height: 1.6em;">สำหรับเกมนี้</strong><strong style="line-height: 1.6em;"> คือ สิ่งที่ไม่ดีจากมอนสเตอร์ที่เราได้ทำการฆ่าในทุกๆ ตัวซึ่ง Soul ที่เราได้มา&nbsp; จะสามารถแปรเปลี่ยนเป็นพลังสำหรับเรา แต่ Soul ที่ได้มานั้นจะยังไม่สามารถนำไปใช้ได้เลยทันที แต่จะต้องมีการนำมาชำระล้าง Soul เหล่านั้นเสียก่อน</strong></span></p>\r\n\r\n<p><span style="font-size:16px;"><strong><u>วิธีการชำระล้างให้ </u></strong><strong><u>Soul บริสุทธิ์<br />\r\nแบ่งออกเป็น 2 วิธี<br />\r\n1. ใช้ Soul Sanctuary </u></strong></span></p>\r\n\r\n<ul>\r\n	<li><span style="font-size:16px;">ไปที่ Soul Sanctuary &nbsp;&nbsp;ซึ่งจะหาได้ตามเมือง และแคมป์ที่กระจายในแต่ละ Map</span></li>\r\n	<li><span style="font-size:16px;">&nbsp;กด &ldquo;V&rdquo; เพื่อเปิดหน้า ของกระเป๋า Soul จากนั้นกดปุ่ม &ldquo;ชำระล้าง&rdquo; ระบบจะทำการสุ่ม Soul Skill ที่ได้ (จะได้ 2 Soul ต่อ 1 Soul Skill)<br />\r\n	<img alt="SoulSystem" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/soulsystem/Soul2.jpg" style="opacity: 0.9; width: 371px; height: 121px;" />&nbsp;<img alt="Soul System" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/soulsystem/Soul1.jpg" style="width: 640px; height: 400px;" />&nbsp; &nbsp;&nbsp;<br />\r\n	<br />\r\n	<strong>ตัวอย่าง Clip</strong></span><br />\r\n	<br />\r\n	<br />\r\n	<iframe allowfullscreen="" frameborder="0" height="480" src="//www.youtube.com/embed/xZ2YvHmlQak" width="853"></iframe></li>\r\n</ul>\r\n\r\n<p><span style="font-size:16px;"><strong><u>2 .ชำระล้างSoul กับผู้เล่นด้วยกันเอง</u></strong></span></p>\r\n\r\n<ul>\r\n	<li><span style="font-size:16px;">คลิกขวาที่เพื่อนเลือก &ldquo;ขอชำระล้าง Soul&rdquo; จะแสดงหน้าต่าง &ldquo;ชำระล้างโซลซึ่งกันและกัน&rdquo;</span></li>\r\n	<li><span style="font-size:16px;">ใส่จำนวนของ Soul ที่อยากชำระล้างในช่อง Soul of Chaos pieces</span></li>\r\n	<li><span style="font-size:16px;">กด &ldquo;บันทึก&rdquo; และกด &ldquo;ชำระล้าง&rdquo;</span></li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp;<img alt="SoulSystem" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/soulsystem/Soul4User.jpg" style="line-height: 1.6em; opacity: 0.9; font-size: 16px; width: 197px; height: 247px;" />&nbsp; &nbsp;<img alt="SoulSystem" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/soulsystem/Soul3User.jpg" style="width: 577px; height: 549px;" /></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; <span style="font-size: 16px;"><strong>ตัวอย่าง Clip</strong></span><br />\r\n<br />\r\n<br />\r\n<iframe allowfullscreen="" frameborder="0" height="480" src="//www.youtube.com/embed/hkFWT2GVHdQ" width="853"></iframe></p>\r\n\r\n<p><strong style="font-size: 16px; line-height: 1.6em;"><u>ข้อดีของการชำระล้าง Soul </u></strong><strong style="font-size: 16px;"><u>กับผู้เล่นด้วยกันเอง</u></strong><strong style="font-size: 16px; line-height: 1.6em;"><u>คือ</u></strong></p>\r\n\r\n<ul>\r\n	<li><span style="font-size:16px;">1. สามารถชำระล้าง Soul ได้นอกพื้นที่ Soul Sanctuary</span></li>\r\n	<li><span style="font-size:16px;">2. จะได้รับ 1 Soul ต่อ 1 Soul Skill</span></li>\r\n</ul>\r\n\r\n<p style="margin-left: 40px;"><span style="font-size:16px;">​</span></p>\r\n\r\n<p><strong style="font-size: 16px; line-height: 1.6em;"><u>คุณสมบัติของ </u></strong><strong style="font-size: 16px; line-height: 1.6em;"><u>Soul แต่ละสี</u></strong></p>\r\n\r\n<p><span style="font-size:16px;">กด &ldquo;T&rdquo; เพื่อใช้พลังของ Soul</span></p>\r\n\r\n<table border="0" cellpadding="0" cellspacing="1" style="width:100.0%;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width:5.0%;">\r\n			<p><img alt="SoulSystem" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/soulsystem/Skill1.jpg" style="width: 57px; height: 58px;" /></p>\r\n			</td>\r\n			<td style="width:20.0%;">\r\n			<p><span style="font-size:16px;"><strong><u>Guidance of Hope</u></strong></span></p>\r\n			</td>\r\n			<td style="width:67.0%;">\r\n			<p><span style="font-size:16px;">เพิ่มพลังโจมตี Critical และโจมตีทะลุเกราะ, ความเร็วในการโจมตีและความเร็วในการร่ายเวทย์มนต์เพิ่มขึ้น ได้รับค่าประสบการณ์เพิ่มขึ้น</span></p>\r\n			</td>\r\n			<td style="width:8.0%;">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><img alt="SoulSystem" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/soulsystem/Skill3.jpg" style="opacity: 0.9; width: 56px; height: 58px;" /></p>\r\n			</td>\r\n			<td>\r\n			<p><span style="font-size:16px;"><strong><u>Pure Will</u></strong></span></p>\r\n			</td>\r\n			<td>\r\n			<p><span style="font-size:16px;">พลังป้องกันและพลังป้องกันระยะประชิดเพิ่มขึ้น ได้รับค่าประสบการณ์เพิ่มขึ้น</span></p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><img alt="SoulSystem" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/soulsystem/Skill4.jpg" style="width: 55px; height: 55px;" /></p>\r\n			</td>\r\n			<td>\r\n			<p><span style="font-size:16px;"><strong><u>Flame of Courage</u></strong></span></p>\r\n			</td>\r\n			<td>\r\n			<p><span style="font-size:16px;">เพิ่มพลังโจมตี,ความเร็วในการโจมตีและความเร็วในการร่ายเวทย์เพิ่มขึ้น ได้รับค่าประสบการณ์เพิ่มขึ้น</span></p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><img alt="SoulSystem" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/soulsystem/Skill2.jpg" style="width: 56px; height: 53px;" /></p>\r\n			</td>\r\n			<td>\r\n			<p><span style="font-size:16px;"><strong><u>Hand of Peace</u></strong></span></p>\r\n			</td>\r\n			<td>\r\n			<p><span style="font-size:16px;">พลังชีวิตสูงสุดเพิ่มขึ้น ได้รับค่าประสบการณ์เพิ่มขึ้น</span></p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', 'ข้อมูลเบื้องต้นเกี่ยวกับ Soul System', 2, 7, 7, '2014-07-03 23:20:31', '2014-07-04 23:33:01'),
(17, 'จุดเริ่มต้นของเลเวล 60', 'http://gurugames.local/images/fashion-q-c-470-300-9.jpg', '<p><span style="line-height: 1.6em;">เมื่อตัวละครเลเวล 60 ในการลงดันเจี้ยน หรือ ทำเควสประจำวันจะมีค่าชุดเครื่องแต่งกายเพิ่มขึ้นมาเป็นข้อกำหนดในการเข้าด่านนั้นๆ ดังนั้นเราจึงต้องหาเครื่องแต่งกายที่ทำให้ผลรวมของค่าเครื่องแต่งกายของเราเกินค่ากำหนดเสียก่อน โดยขั้นแรก</span><span style="line-height: 1.6em;">จะมีเควสเด้งขึ้นมาให้กดรับชื่อ ความยากลำบากอย่างต่อเนื่อง&nbsp;</span></p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/quest_blue_set_01.jpg" style="width: 600px; height: 564px;" /></p>\r\n\r\n<p>เควสนี้จะให้เราลงดันเจี้ยน Draken&#39;s Laboratory ในโหมด Solo Hero สามารถเข้าดันเจี้ยนผ่านทาง Smart Matching ได้เลย</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/quest_blue_set_02.jpg" style="width: 400px; height: 517px;" /></p>\r\n\r\n<p>โดยการลงดันเจี้ยน 1 ครั้ง บอสจะสุ่มดรอปชุดเซ็ทสีฟ้าให้เรา 2-3 ชิ้น ต่อ 1 ครั้ง โดยหากเราทำเควสนี้ 4 ครั้ง เแล้วยังไม่ได้ชุดฟ้าเซ็ทเดียวกันทั้งหมดก็สามารถนำของรางวัลจากการทำเควสนี้ซึ่งเป็นเหรียญพิเศษมาอีก 5 อันนำไปแลกชุดเซ็ทสีฟ้าครบเซ็ทได้จาก&nbsp;NPC ที่ชื่อ Akim ได้ในเมือง ignea</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/quest_blue_set_03.jpg" style="width: 400px; height: 367px;" /></p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/quest_blue_set_04.jpg" style="line-height: 1.6em; width: 600px; height: 381px;" /></p>\r\n\r\n<p>เพียงเท่านี้เราก็จะได้ชุดเซ็ทฟ้าใส่ทั้งตัวเพื่อการตะลุยเควสและดันเจี้ยนหลังเลเวล 60 แล้ว</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/quest_blue_set_05.jpg" style="width: 400px; height: 379px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'เมื่อตัวละครเลเวล 60 ในการลงดันเจี้ยน หรือ ทำเควสประจำวันจะมีค่าชุดเครื่องแต่งกายเพิ่มขึ้นมาเป็นข้อกำหนดในการเข้าด่านนั้นๆ ดังนั้นเราจึงต้องหาเครื่องแต่งกายที่ทำให้ผลรวมของค่าเครื่องแต่งกายของเราเกินค่ากำหนดเสียก่อน โดยขั้นแรกจะมีเควสเด้งขึ้นมาให้กดรับชื่อ ความยากลำบากอย่างต่อเนื่อง', 2, 3, 5, '2014-07-21 17:38:22', '2014-07-21 19:04:59'),
(20, 'ASIASOFT ปิดตัวเซิฟเวอร์เกม RO2 ในมาเลเซีย และสิงคโปร์', 'http://www.gurugames.in.th/images/upload/files/ro2.jpg', '<p><span style="color:#0000FF;"><strong>Asiasoft</strong></span> ได้ประกาศอย่างเป็นทางการว่าจะปิดเซิฟเวอร์ <strong>Ragnarok Online II: Legend of the Second (RO2)</strong> ของมาเลเซีย และสิงคโปร์ ใน <span style="color:#FF0000;"><strong>วันที่ 9 ตุลาคม 2014 </strong></span><br />\r\nไม่ว่าจะเป็นตัวเกม หรือระบบสมาชิก รวมถึงระบบเติมเงิน จะไม่สามารถใช้ในตั้งแต่วันดังกล่าว<br />\r\nแต่ยังไม่สิ้นสุดเพียงเท่านี้สำหรับผู้เล่นในโซนดังกล่าว คุณสามารถที่จะโอนย้ายตัวละคร ไปยังไอดีของ RO2 ใน North American ได้ด้วย<br />\r\nแฟนๆ RO2 ใน SEA สามารถตรวจสอบรายละเอียดได้จาก<strong> <a href="http://blog.warpportal.com/?page_id=6694">ที่นี้</a></strong></p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/files/ro2-sea-cbt2_3nja.jpg" /></p>\r\n\r\n<p>หลังจากได้ทำการเปิดตัว open beta ของเซิฟเวอร์ SEA เมื่อวันที่ 3 มกราคม 2013<br />\r\nซึ่งช่วงแรกของการเปิดตัวเกมนั้นได้มีปัญหาทางด้านเกมและเซิฟเวอร์ต่างๆมากมาย<br />\r\nจนสุดท้ายในที่สิ้นสุดของเกม RO2 ที่ทุกคนรอคอยว่าจะสมหวัง<br />\r\nจากการที่รอคอยมานานนับตั้งแต่ที่เคยเป็นตำนานจาก RO1 ก็ได้สิ้นสุดลง</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/files/ro2_ss.jpg" /></p>\r\n\r\n<p>การปิดตัวครั้งนี้ทำให้แสดงเห็นว่า<strong> RO2</strong> กำลังลดความนิยมเป็นอย่างมาก<br />\r\nเห็นได้จากทาง <strong>RO2</strong> เซิฟเวอร์เกาหลี ก็ได้ปิดตัวลงไปก่อนหน้านี้แล้ว<br />\r\nแต่ทาง <strong>gravity</strong> เคยบอกไว้ว่าจะยังคงอัพเดท และพัฒนาต่อ สำหรับแฟนๆ<strong> RO2</strong> ที่ยังเล่นอยู่ในภูมิภาคอื่นๆ<br />\r\nซึ่งเมื่อถึงคราวของ SEA ปิดตัวลง ก็คงเหลือแต่ในประเทศไทยที่ยังมีลิขสิทธิ์ของ <strong>RO2</strong> อยู่<br />\r\nส่วนเซิฟเวอร์ในประเทศไทยนั้น ยังไม่มีข่าวใดๆออกมา หวังว่าเกมเมอร์<strong> RO2</strong> ชาวไทย ยังคงเฮได้ต่อไปเรื่อยๆในอนาคต</p>\r\n', 'Asiasoft ได้ประกาศอย่างเป็นทางการว่าจะปิดเซิฟเวอร์ Ragnarok Online II: Legend of the Second (RO2) ของมาเลเซีย และสิงคโปร์ ในวันที่ 9 ตุลาคม 2014', 0, 5, 5, '2014-09-11 18:25:55', '2014-09-11 18:55:32');
INSERT INTO `content` (`contentId`, `title`, `image`, `detail`, `shortDetail`, `gameId`, `userCreate`, `userUpdate`, `dateCreate`, `dateUpdate`) VALUES
(21, 'Review Dot Arena เกมมือถือที่เอาตัวละคร DotA มาโลดแล่นในรูปแบบ 2.5D อย่างลงตัว', 'http://gurugames.local/images/upload/dotarena/dotarena.jpg', '<p>หลังจากเกม <strong><span style="color:#FF0000;">Dot Arena</span></strong> ได้เปิดตัวอย่างเป็นทางการในวันที่ 18 กันยายนที่ผ่านมา มีผู้ให้ความสนใจเล่นกันอย่างล้นหลามโดยเฉพาะสาวก DotA ได้แห่กันเข้ามาทดลองเล่น&nbsp;<span style="line-height: 1.6em;">เพราะว่าเกม Dot Arena นี้ได้เอาตัวละครของ DotA มาสร้างเป็นตัวละครในเกม ในรูปแบบ SD ทั้งน่ารักและเท่ในเวลาเดียวกัน</span></p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/dotarena/gurugames dotarena_1.jpg" style="width: 640px; height: 480px;" /></p>\r\n\r\n<p>ตัวอย่างฮีโร่ เพื่อนๆดูปราดเดียวก็คงอ๋อเลยว่าตัวอะไร</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>-</strong>รู<strong>ปแบบการเล่น</strong> เราสามารถเอาฮีโร่ลงสู้พร้อมกันได้ 5 ตัว เป้าหมายคือเราจะต้องฆ่าฝั่งตรงข้ามให้หมด โดยที่ฮีโร่แต่ละตัวจะเดินและโจมตีเองอัติโนมัติ สิ่งเดียวที่เราจะสั่งการได้คือการให้ฮีโร่ใช้สกิลอัลติเมต โดยการ tab ที่รูปฮีโร่ด้านล่าง</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/dotarena/gurugames dotarena_2.jpg" style="width: 640px; height: 480px;" /></p>\r\n\r\n<p>หลอดมานา(สีเหลือง) เต็มเมื่อไร่ก็ tab ที่รูปฮีโร่ด้านล่างก็จะเป็นการใช้อัลติเมตทันที</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>-ระบบสวมใส่อาวุธ</strong>&nbsp;สามารถใส่ได้ 6ช่อง ซึ่งรูปร่างหน้าตาของอาวุธเพื่อนๆ ก็น่าจะคุ้นเคยกันดี เพราะมาจาก DotA ทั้งหมด นอกจากเราจะสามารถตีบวกอาวุธได้เหมือนเกมอื่นๆแล้ว เกมนี้จะพิเศษกว่าอีกหน่อยตรงที่ว่าถ้าเราสามารถหาอาวุธมาใส่ให้ฮีโร่ได้ครบทั้ง 6ช่อง&nbsp;ฮีโร่จะพัฒนาตัวเองขึ้นไปอีกขั้น ทำให้ได้เรียนรู้สกิลใหม่ๆ และดูดค่าพลังของอุปกรณ์ชนิดนั้นๆ ไปเป็นค่าพลังของหลักตัวเองเลย และยังสามารถใส่อุปกรณ์อื่นๆ เพิ่มเข้าไปใหม่ได้อีก 6ช่อง</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/dotarena/gurugames%20dotarena_8.jpg" style="width: 640px; height: 427px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>-ระบบพัฒนาสกิล</strong> แน่นอนว่าสกิลก็มีเลเว่ลของสกิลเช่นกัน เราสามารถพัฒนาได้โดยการใช้เงินในเกม อัพเกรดสกิลได้เลย</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/dotarena/gurugames%20dotarena_9.jpg" style="width: 640px; height: 427px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>-ระบบการเก็บ soul เพื่อปลุกชีพฮีโร่ </strong>เกมนี้จะมีระบบการเปิดหีบสุ่มฮีโร่เหมือนกับเกมดังอื่นๆ ในช่วงนี้ (ผมขอเรียกระบบนี้ว่าระบบ เปิดหีบเทพลุ้นแรร์) ซึ่งเกมอื่นๆคนไม่ได้เติมตังก็หวังสู้คนเติมเยอะๆไม่ได้แน่นอน&nbsp;แต่เกมนี้จะไม่ใจร้ายขนาดนั้นเราสามารถเปิดหีบธรรมดาแต่วันละ 5หีบฟรีๆ ส่วนหีบเทพเปิดได้&nbsp;2วันต่อหีบฟรีเช่นกัน ซึ่งหมายความว่าเราไม่ต้องเติมเยอะก็สามารถลืมตาอ้าปากได้ ถ้าใช้เวลาเล่นนานหน่อย นอกจากนี้แล้วเกมนี้ยังมีระบบเก็บ soul โดยที่ soul พวกนี้จะมีดรอปตามฉาก ถ้าเราเก็บ soul ของฮีโร่ตัวนี้ครบ 20 ชิ้น ก็จะสามารถนำฮีโร่ตัวนี้เป็นพวกเราได้ แต่ถ้ามีฮีโร่ตัวนี้อยู่แล้ว แล้วสามารถเก็บ soul มาได้อีก 20ชิ้น จะสามารถทำให้ฮีโร่พัฒนาไปได้อีกขั้น</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/dotarena/gurugames%20dotarena_14.jpg" style="width: 640px; height: 427px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>-&quot;ไม่มี&quot;ระบบเอาฮีโร่มากินกันเอง</strong> เพื่อเพิ่ม level หรือใช้ในการ evolve ย้ำอีกทีว่า &quot;ไม่มี&quot; ผมเป็นคนหนึ่งที่เวลาเล่นเกมจะชอบสะสมทุกอย่างให้ครบ แน่นอนรวมถึงตัวฮีโร่ด้วย แต่เกมบางเกมจะมีระบบที่ว่ามาข้างต้น และจำกัดช่องการเก็บฮีโร่ของเรา ทำให้เราไม่สามารถสะสมได้เลย ต้องเล่นเพื่อปั้นฮีโร่เราของเราให้เทพแค่นั้น แต่เกมนี้ค่อนข้างจะตอบโจทย์ผมในด้านนี้ คือเราสามารถเก็บสะสมฮีโร่ทุกตัวไว้ได้ และพัฒนามันไปเรื่อยๆ ไม่ต้องมีการกินทิ้ง หรือขายทิ้ง เหมือนอย่างเกมอื่นหลายๆเกม&nbsp;</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/dotarena/gurugames%20dotarena_10.jpg" style="width: 640px; height: 427px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>-ระบบพัฒนาอาวุธ</strong> การตีบวกอาวุธของเกมนี้จะใช้วิธีนำอาวุธอื่นๆที่เราไม่ใช้นำมาหลอมรวมเป็นจำนวนเยอะๆ เมื่อถึงระดับที่ต้องการก็จะเพิ่มค่าพลังให้กับอาวุธเดิมของเราได้ ข้อดีคือไม่ต้องกลัวตีแล้วอาวุธพังและไม่ต้องนั่งหาวัตถุดิบ เพราะของทุกชิ้นสามารถนำมาหลอมได้หมด</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/dotarena/gurugames%20dotarena_11.jpg" style="width: 640px; height: 427px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>-ระบบลงดันเจี้ยน</strong> อันนี้คงไม่ต้องอธิบายมากก็คือลงดันเจี้ยนสู้บอสยากๆ หาของเทพๆ จบ</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/dotarena/gurugames%20dotarena_7.jpg" style="width: 640px; height: 427px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>-ระบบสู้กับเพื่อน </strong>เราสามารถสู้กับผู้เล่นคนอื่นได้เพื่อไต่อันดับของเรา และถ้าเรายิ่งอยู่อันดับสูงๆ ก็จะได้รับผลตอบแทนที่ดีขึ้นเรื่อยๆ</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/dotarena/gurugames dotarena_6.jpg" style="width: 640px; height: 480px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>-ระบบกิลล์ </strong>ยังไม่รู้</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'หลังจากเกม Dot Arena ได้เปิดตัวอย่างเป็นทางการในวันที่ 18 กันยายนที่ผ่านมา มีผู้ให้ความสนใจเล่นกันอย่างล้นหลามโดยเฉพาะสาวก DotA ได้แห่กันเข้ามาทดลองเล่น เพราะว่าเกม Dot Arena นี้ได้เอาตัวละครของ DotA มาสร้างเป็นตัวละครในเกม ในรูปแบบ SD ทั้งน่ารักและเท่ในเวลาเดียวกัน', 3, 2, 5, '2014-09-21 17:04:32', '2014-09-30 20:58:26'),
(22, 'Middle-earth: Shadow of Mordor gameplay: max settings at 2560x1440 on LPC', 'DrzSBpkxbqw', '<p><iframe frameborder="0" height="580" scrolling="no" src="http://www.youtube.com/embed/DrzSBpkxbqw" width="750"></iframe></p>\r\n', '', 0, 5, 5, '2014-09-26 09:36:11', '2014-09-26 11:24:08'),
