(28, 'จุดเริ่มต้นของเลเวล 60', 'http://gurugames.local/images/nightlife-q-c-470-300-6.jpg', '<p><span style="line-height: 1.6em;">เมื่อตัวละครเลเวล 60 ในการลงดันเจี้ยน หรือ ทำเควสประจำวันจะมีค่าชุดเครื่องแต่งกายเพิ่มขึ้นมาเป็นข้อกำหนดในการเข้าด่านนั้นๆ ดังนั้นเราจึงต้องหาเครื่องแต่งกายที่ทำให้ผลรวมของค่าเครื่องแต่งกายของเราเกินค่ากำหนดเสียก่อน โดยขั้นแรก</span><span style="line-height: 1.6em;">จะมีเควสเด้งขึ้นมาให้กดรับชื่อ ความยากลำบากอย่างต่อเนื่อง&nbsp;</span></p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/quest_blue_set_01.jpg" style="width: 600px; height: 564px;" /></p>\r\n\r\n<p>เควสนี้จะให้เราลงดันเจี้ยน Draken&#39;s Laboratory ในโหมด Solo Hero สามารถเข้าดันเจี้ยนผ่านทาง Smart Matching ได้เลย</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/quest_blue_set_02.jpg" style="width: 400px; height: 517px;" /></p>\r\n\r\n<p>โดยการลงดันเจี้ยน 1 ครั้ง บอสจะสุ่มดรอปชุดเซ็ทสีฟ้าให้เรา 2-3 ชิ้น ต่อ 1 ครั้ง โดยหากเราทำเควสนี้ 4 ครั้ง เแล้วยังไม่ได้ชุดฟ้าเซ็ทเดียวกันทั้งหมดก็สามารถนำของรางวัลจากการทำเควสนี้ซึ่งเป็นเหรียญพิเศษมาอีก 5 อันนำไปแลกชุดเซ็ทสีฟ้าครบเซ็ทได้จาก&nbsp;NPC ที่ชื่อ Akim ได้ในเมือง ignea</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/quest_blue_set_03.jpg" style="width: 400px; height: 367px;" /></p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/quest_blue_set_04.jpg" style="line-height: 1.6em; width: 600px; height: 381px;" /></p>\r\n\r\n<p>เพียงเท่านี้เราก็จะได้ชุดเซ็ทฟ้าใส่ทั้งตัวเพื่อการตะลุยเควสและดันเจี้ยนหลังเลเวล 60 แล้ว</p>\r\n\r\n<p><img alt="" class="img-responsive" src="http://www.gurugames.in.th/images/upload/eos/content/quest_blue_set_05.jpg" style="width: 400px; height: 379px;" /></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'เมื่อตัวละครเลเวล 60 ในการลงดันเจี้ยน หรือ ทำเควสประจำวันจะมีค่าชุดเครื่องแต่งกายเพิ่มขึ้นมาเป็นข้อกำหนดในการเข้าด่านนั้นๆ ดังนั้นเราจึงต้องหาเครื่องแต่งกายที่ทำให้ผลรวมของค่าเครื่องแต่งกายของเราเกินค่ากำหนดเสียก่อน โดยขั้นแรกจะมีเควสเด้งขึ้นมาให้กดรับชื่อ ความยากลำบากอย่างต่อเนื่อง', 2, 3, 5, '2014-07-21 17:38:22', '2014-07-21 19:04:59'),
(25, 'Na`Vi Dendi - Shadow Fiend (MMR Gameplay)', 'gGWLElAW0hk', '<p><iframe frameborder="0" height="480" scrolling="no" src="http://www.youtube.com/embed/gGWLElAW0hk" width="750"></iframe></p>\r\n', '', 0, 5, 5, '2014-09-26 09:36:11', '2014-09-26 11:23:27'),
